

const table = (function($, win){
  var table = {
    init: function(){
      const _self = this;
      console.log('exec');
      _self.setData();
    },
    fetch: function(){
      const _self = this;
      console.log(11);
      return new Promise((resolve, reject) => {
        setTimeout(function() {
          resolve({
            "officer":{
              "id":1,
              "name":"车俊",
              "gender":"男",
              "hometown":"安徽巢湖",
              "nation":"汉",
              "university":"中央党校",
              "degree":"中央党校大学学历",
              "title":"省委书记",
              "birthday":150000000000,
              "ccp_date":150000000000,
              "work_date":150000000000,
              "description":"官员简介说明",
              "photo":"data:image/jpeg;base64,",
              "list_pic":"http://www.123123.com/photo.png ",
              "resumes":[
                  {
                    "year":2017,
                    "month":7,
                    "location":"杭州",
                    "title":"职务"
                  },
                  {
                    "year":2017,
                    "month":6,
                    "location":"杭州",
                    "title":"职务"
                  }
              ]
            },
            "article_list":[
              {}
            ]
          });
        }, 500);
      });
    },
    setData: function(){
      const _self = this;
      _self.fetch().then((data) => {
        _self.tepl(data);
      }, (err) => {
        console.log(err);
      }).catch((err) => {
        console.log(err);
      });
    },
    tepl: function(data){
      const _self = this;
      const { name, hometown, nation, university, degree, title, birthday, ccp_date, work_date, photo } = data.officer;
      const tableContent = `
        <tr>
          <th class="avatar">
            <img src="${photo}" />
          </th>
          <th>
            <p class="name">${name}</p>
            <p class="title">${title}</p>
          </th>
        </tr>
        <tr>
          <td class="thead">籍贯</td>
          <td class="content nation">${nation}</td>
        </tr>
        <tr>
          <td class="thead">民族</td>
          <td class="content hometown">${hometown}</td>
        </tr>
        <tr>
          <td class="thead">出生年月</td>
          <td class="content birthday">${_self.getTime(birthday)}</td>
        </tr>
          <tr>
          <td class="thead">入党时间</td>
          <td class="content ccp_time">${_self.getTime(ccp_date)}</td>
        </tr>
        <tr>
          <td class="thead">毕业院校</td>
          <td class="content university">${university}</td>
        </tr>
        <tr>
          <td class="thead">学历/学位</td>
          <td class="content degree">${degree}</td>
        </tr>
        <tr>
          <td class="thead">参与工作时间</td>
          <td class="content work_time">${_self.getTime(work_date)}</td>
        </tr>
      `;
      const table = document.createElement('table');
      table.innerHTML = tableContent;
      document.getElementsByClassName('container')[0].appendChild(table);
      const img = $('img')[0];
      img.onload = function(evt) {
        console.log('img load', img.width, img.height, evt);
      };
    },
    getTime: function(time){
      const date = new Date(time);
      return date.getFullYear() + '年' + date.getMonth() + '月';
    }
  }
  return table;
})(jQuery, window);

table.init();